import React, { useEffect, useState }  from 'react';

function Fecha(){

    const url = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/';
    const [fecha, setFecha] = useState();

    useEffect(() => {
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch(url);
        const fecha = await data.json();
        setFecha(fecha.Fecha);
    }

    console.log(fecha)

    return(
        <footer className='bg-light text-center text-lg-start'>
        <p className='text-center'>Fecha y hora de precios: {fecha}</p>
        <p className='text-center'> Fuente de los datos: 	https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/</p>
        </footer>
    );
}

export default Fecha;
